REPLACE INTO "delicious" VALUES (2,'http://www2.unt.se/avd/1,,MC=77-AV_ID=911177,00.html','He works for democracy in Iraq','Organization Life-Link from Uppsala to become a bridge builder in the war-torn Iraq. Eight schools in Baghdad will start the Life-Link peace and environmental projects this year. The aim is to spread democracy and tolerance between young people from diffe','2010-01-05 11:43:15');
REPLACE INTO "delicious" VALUES (14,'http://www.ted.com/talks/michael_pritchard_invents_a_water_filter.html','Michael Pritchard\'s water filter turns filthy water drinkable','Too much of the world lacks access to clean drinking water. Engineer Michael Pritchard did something about it -- inventing the portable Lifesaver filter, which can make the most revolting water drinkable in seconds. An amazing demo from TEDGlobal 2009.','2010-01-05 11:08:27');
